import Question from './Question';

const questionsList = [
  {
    questionText: 'A',
    answersOptions: [ '1','2','3','4']
  },
  {
    questionText: 'B',
    answersOptions: [ '1','2','3','4']
  },
  {
    questionText: 'C',
    answersOptions: [ '1','2','3','4']
  },
  {
    questionText: 'D',
    answersOptions: [ '1','2','3','4']
  },
];

function App() {
  return (
    <div className="App">
      {questionsList.map(q => {
        return (
          <Question></Question>
        )
      })}
    </div>
  );
}

export default App;
